    for (int i = 0; i < m; ++i) {
        cin >> b[i];
    }
    for (int i = 0; i < k; ++i) {
        cin >> c[i];
    }
    for (int i = 0; i < n; ++i) {
        for (int j = 0; j < m; ++j) {
